    useProtectedPage()

    return (
        <ScreenContainer>
          <RecipeContainer>
            <Typography gutterBottom variant={'h4'} align={'center'} color={'textPrimary'}>Adicionar Nova Receita</Typography>
            <AddRecipesForm/>
          </RecipeContainer>
        </ScreenContainer>
      )

};
